  false,\n\t\"url\": null,\n\t\"notes\": \"These data provide generalized outlines
  of major basins and uplifts in the Gulf Coast region modified after Plate 2, Principal
  structural features, Gulf of Mexico Basin (compiled by T.E. Ewing and R.F. Lopez)
  in Volume J, The Geology of North America (1991). This dataset contains basic data
  and interpretations developed and compiled by the U.S. Geological Survey's Framework
  Studies and Assessment of the Gulf Coast Project. Other major sources of data include
  publicly available information from state agencies as well as publications of the
  U.S. Geological Survey and other scientific organizations. In cases where company
  proprietary data were used to produce various derivatives such as contour surfaces,
  the source is cited but the data are not displayed.\",\n\t\"license_title\": null,\n\t\"extras\":
